export function createFormData<T>(data: T): FormData {
  let formdata = new FormData();

  // if (typeof data !== "object") throw new Error("안 옴");

  for (const key in data) {
    let value = data[key];
    if (value) formdata.append(key, value);
  }

  return formdata;
}
